	// faster version of (int)Math.sqrt(x)
	// throws an exception if x >= 32000
	// costs ~5 bytecodes while Math.sqrt is ~20 bytecodes (see MethodCosts.txt)
	public static int floorSqrt(int x) {
		return lookupFloorSqrt.charAt(x);
	}

	// faster version of (int)Math.round(Math.sqrt(x))
	// throws an exception if x >= 32000
	// costs ~5 bytecodes while Math.sqrt is ~20 bytecodes (see MethodCosts.txt)
	public static int roundSqrt(int x) {
		return lookupRoundSqrt.charAt(x);
	}

	// call FastMath.initRand(rc) before using FastMath.rand256()
	private static int randIndex = -1;
	public static final int MAX_RAND_CALLS = 10000; // don't call rand256 more than this many times per game
	public static void initRand(RobotController rc) {
		randIndex = Math.abs(rc.getRoundNum()*23981 + rc.getID()*10289) % 
				(lookupRand256.length() - MAX_RAND_CALLS);
	}

	// faster version of (int)(256 * Math.random())
	// costs ~10 bytecodes 
	// while Random.nextInt(256) is ~50 bytecodes and (int)(256*Math.random()) is ~75 bytecodes
	// Could also make other versions with a smaller upper limit
	public static int rand256() {
		return lookupRand256.charAt(randIndex++);
	}

	
	public static MapLocation addVec(MapLocation a, MapLocation b) {
		return new MapLocation(a.x+b.x, a.y+b.y);
	}
	
	public static MapLocation minusVec(MapLocation a, MapLocation b) {
		return new MapLocation(a.x-b.x, a.y-b.y);
	}
	
	public static MapLocation multiplyVec(double f, MapLocation a) {
		return new MapLocation((int)Math.round(f * a.x), (int)Math.round(f * a.y));
	}
	
	public static MapLocation negateVec(MapLocation a) {
		return new MapLocation(-a.x, -a.y);
	}
	
	public static int dotVec(MapLocation a, MapLocation b) {
		return a.x * b.x + a.y * b.y;
	}
	
	public static int dotVec(Direction d, MapLocation a) {
		if (d == null) {
			return 0;
		}
		return d.dx * a.x + d.dy + a.y;
	}
	
	public static Direction dirFromVec(MapLocation a) {
		MapLocation origin = new MapLocation(0,0);
		return origin.directionTo(a);
	}
	
